import ListGroup from "react-bootstrap/ListGroup";

const MisList = ({ mis }) => {
  const showDetails = (mis) => {
    console.log("clicked");
    return <ListGroup.Item>{mis.name}</ListGroup.Item>;
  };

  return (
    <>
      <ListGroup as="ul">
        {mis.length === 0
          ? "No"
          : mis.map((mis) => (
              <ListGroup.Item
                as="li"
                key={mis.id}
                onClick={(mis) => showDetails(mis)}
              >
                {mis.name}
                {mis.id}
              </ListGroup.Item>
            ))}
      </ListGroup>
    </>
  );
};

export default MisList;
